import { StyleSheet } from 'react-native'
import COLORS from '../../Constants/styles'

const styles = StyleSheet.create({
  container: {
    alignItems: 'center',
    justifyContent: 'center'
  },
  containerLogo: {
    //alignItems: 'center',
    backgroundColor: COLORS.primary
  },
  logo: {
    marginTop: 30,
    marginBottom: 0,
    width: 90,
    alignSelf: 'center'
    // alignItems: 'center',
    //marginLeft: 'auto',
  },
  header: {
    flexDirection: 'row',
    marginBottom: 30,
    marginLeft: -30
    //marginLeft: 'auto',
    // marginRight: 'auto',
  },
  headerText: {
    color: 'white',
    fontFamily: 'Corbel',
    fontWeight: '300',
    marginTop: 5
  },
  listIcon: {
    alignItems: 'center',
    justifyContent: 'space-between',
    marginRight: 20
  }
})

export default styles
